  false,\n\t\"url\": null,\n\t\"notes\": \"This data set provides estimates of Arctic
  sea ice extent and concentration from 1901 to 1956 created from a collection of
  historic, hand-drawn sea ice charts from the Danish Meteorological Institute (DMI).
  These were used to create estimates for each summer month from 1901 to 1956 by manual,
  subjective interpretation of scanned versions of the charts. These estimates, shown
  in colored-coded fields, are available as image files in JPEG format and as GIS
  shapefiles.\",\n\t\"license_title\": \"License Not Specified\",\n\t\"extras\": [{\n\t\t\"key\":
